export class GuiConfig {

    readonly _maxGrainsVisible: number;
    readonly _grainImgPath: string;
    readonly _wallImgPath: string;
    readonly _hamsterImgPath: string;

    constructor(grainImgPath?: string, wallImgPath?: string, hamsterImgPath?: string, maxGrainsVisible?: number) {
        this._maxGrainsVisible = maxGrainsVisible || 9;
        this._grainImgPath = grainImgPath || "data:image/svg+xml;base64,";
        this._wallImgPath = wallImgPath || "data:image/svg+xml;base64,";
        this._hamsterImgPath = hamsterImgPath || "data:image/svg+xml;base64,";
    }

}